import React, {Component} from 'react';
import {Card, Collapse} from "antd";
import img_OA from '../../images/production/OA.jpg';

const {Meta}=Card;

class Product extends Component {
    render() {
        return (
            <Card style={{width:"496px"}} cover={<img src={img_OA} alt=""/>}>
            <Meta title="OA系统" description="提供基础OA系统" />
            <Collapse></Collapse>
            </Card>
        );
    }
}

export default Product;
